import com.eviware.soapui.support.XmlHolder

def abc=testRunner.testCase.testSuite.testCases["TC_AddEmp"].testSteps["addemp"].getPropertyValue("Request")
def id=testRunner.testCase.testSuite.testCases["TC_GetEmp"].getPropertyValue("id")
def dept=testRunner.testCase.getPropertyValue("dept")
def name=testRunner.testCase.testSuite.getPropertyValue("name")

def xmlAdd=new XmlHolder(abc)
xmlAdd.setNodeValue("//typ:addEmployee/typ:id",id)
xmlAdd.setNodeValue("//typ:addEmployee/typ:name",name)
xmlAdd.setNodeValue("//typ:addEmployee/typ:Department",dept)
xmlAdd.setNodeValue("//typ:addEmployee/typ:age","25")

def newAddXML=xmlAdd.getXml();
testRunner.testCase.testSuite.testCases["TC_AddEmp"].testSteps["addemp"].setPropertyValue("Request",newAddXML)

import com.eviware.soapui.impl.wsdl.testcase.WsdlTestRunContext
def tsAdd = testRunner.testCase.testSuite.testCases["TC_AddEmp"].testSteps["addemp"]
def cntxtAdd = new WsdlTestRunContext(tsAdd)
tsAdd.run(testRunner,cntxtAdd)


def vResponse=testRunner.testCase.testSuite.testCases["TC_AddEmp"].testSteps["addemp"].getPropertyValue("Response")
def vGetRes= new XmlHolder(vResponse)

//def vNameRes=vGetRes.getNodeValue("//ns:return")
//assert vNameRes=="true"

def vNameRes=vGetRes.getNodeValue("//ax21:message")
assert vNameRes=="Employee already Exists"
log.info "AddEmpScript ended"

